(function() {
    
    var images = {
        people: 'data:image/png;base64,',
        robot: 'data:image/png;base64,',
        ufo: 'data:image/png;base64,',
        ufo_explosion: 'data:image/png;base64,'
    };
    
    console.log(window.innerHeight, window.innerWidth);
    
    var count = 0;
    var cycle = function() {
        Object.each(images, function(imageData, name) {
            var img = new Element('img', {
                src: imageData,
                styles: {
                    position: 'absolute',
                    top: Number.random(0, window.innerHeight-100) + 'px',
                    left: Number.random(0, window.innerWidth - 100) + 'px'
                }
            });
            $$('body')[0].adopt(img);
        });
        if (count++ === 12) {
            clearInterval(cycle);
        }
    }.periodical(2000);
})();